import React from 'react';
import cardList from './CardList';
import { robots } from './robots'


const app = () => {
    return (
        robots.map((user, index) => {
        return (
            <Card
            key={robots[index].id}
            id={robots[index].id}
            name={robots[index].name}
            email={robots[index].email}
            />
        );
    })
    )}
